import React from "react";
import Card from "./card";

import imgeas from "./img_portofolio/eamockup.svg"
import imgem from "./img_portofolio/emmockup.svg"
import imgls from "./img_portofolio/lsmockup.svg"
import imgpa from "./img_portofolio/pamockup.svg"

function project(){
    return(
        <div className="px-15percent my-10">
            <h3>the project that I have made</h3>
            <h1 className="text-3xl font-extrabold">Project</h1>
            <div className="grid lg:grid-cols-3 sm:grid-cols-2 gap-4 mt-3">
                <Card imgsrc={imgeas}/>
                <Card imgsrc={imgem}/>
                <Card imgsrc={imgls}/>
                <Card imgsrc={imgpa}/>
            </div>
        </div>
    )
}

export default project;
